public int hashCode() {
  final int prime = 31;
  int result = 1;
  result =
      prime * result + ((filterList == null) ? 0 : filterList.hashCode());
  result =
      prime * result + ((operator == null) ? 0 : operator.hashCode());
  return result;
}
